                ans.push_back('1' + makeLargestSpecial(s.substr(i+1,j-i-1)) + '0');
                i = j+1;  // update the index to the next character after the current 'special' substring.
            }
        }

        sort(ans.begin(),ans.end(),greater<string>());
        string finalString = "";
        for(int i=0;i<ans.size();i++){
            finalString += ans[i];
        }
        return finalString;
    }
};
